import os
import tkinter as tk
import webbrowser as web
import base64

table = 'fZodR9XQDSUm21yCkr6zBqiveYah8bt4xsWpHnJE7jL5VG3guMTKNPAwcF'
tr = {}
s = [11, 10, 3, 8, 4, 6]
xor = 177451812
add = 8728348608

for i in range(58):
    tr[table[i]] = i


def dec(x):
    r = 0
    for i in range(6):
        r += tr[x[s[i]]] * 58 ** i
    return (r - add) ^ xor


def enc(x):
    x = (x ^ xor) + add
    r = list('BV1  4 1 7  ')

    for i in range(6):
        r[s[i]] = table[x // 58 ** i % 58]
    return ''.join(r)


def transform():
    global output
    show.clipboard_clear()
    var = enter.get()
    output = 'av' + str(dec(var))
    show.insert('insert', output)


def open_website():
    web.open('https://www.bilibili.com/video/' + output)


def get_pic(pic_code, pic_name):
    image = open(pic_name, 'wb')
    image.write(base64.b64decode(pic_code))
    image.close()


root = tk.Tk()
root.title('BV to AV | algorithm by.mcfx@知乎| GUI by.Afterlife来生再世@bilibili')
root.geometry('550x50')
ico_code = b''
get_pic(ico_code, 'bilibili.ico')
root.iconbitmap('bilibili.ico')
os.remove('bilibili.ico')

text_bv = tk.Label(root, text='BV号:', height=2, font='微软雅黑')
blank1 = tk.Label(root, text='', width=2)
blank2 = tk.Label(root, text='', width=2)
blank3 = tk.Label(root, text='', width=2)
text_av = tk.Label(root, text='AV号:', height=2, font='微软雅黑')
enter = tk.Entry(root, width=20, show=None)
button = tk.Button(root, text='转换', height=1, command=transform)
button_tz = tk.Button(root, text='跳转', height=1, command=open_website)
show = tk.Text(root, width=20, height=2)

text_bv.grid(row=1, column=0)
enter.grid(row=1, column=1)
blank1.grid(row=1, column=2)
button.grid(row=1, column=3)
blank3.grid(row=1, column=4)
text_av.grid(row=1, column=5)
show.grid(row=1, column=6)
blank2.grid(row=1, column=7)
button_tz.grid(row=1, column=8)

root.mainloop()
